a Yoga comes under Akriti Yogas of the Nabhasha Yogas mentioned in B. V. Raman\\'s 300 Important Combinations. Nabasha Yogas is described in other old astrological texts also like Brihat Jataka and Brihat Parashara Hora Shastra(BPHS).<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">How is Kulvardhana Yoga formed?<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yupa Yoga is a very simple yoga formed when seven planets including Sun, Moon, Mars, Mercury, Jupiter, Venus and Saturn occupy first four houses. All these seven planets should occupy:<\/p>\\r\\n<ol>\\r\\n<li>First House(ascendant)<\/li>\\r\\n<li>Second House<\/li>\\r\\n<li>Third House<\/li>\\r\\n<li>Fourth House<\/li>\\r\\n<\/ol>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First thing to count is distance of Jupiter from Saturn. If Saturn and Jupiter are separated by five signs than this yoga cannot occur. For example if Saturn enters Pisces and Jupiter travels to Cancer than this yoga will not occur.<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">Examples Of Yupa Yoga<\/div>\\r\\n<ul class=\\\"nav nav-pills\\\">\\r\\n<li class=\\\"nav-item\\\"><a href=\\\"#north-564\\\" class=\\\"nav-link active\\\" data-toggle=\\\"tab\\\">North Style<\/a><\/li>\\r\\n<li class=\\\"nav-item\\\"><a href=\\\"#south-564\\\" class=\\\"nav-link\\\" data-toggle=\\\"tab\\\">South Style<\/a><\/li>\\r\\n<\/ul>\\r\\n<div class=\\\"tab-content\\\">\\r\\n<div class=\\\"mb-3\\\">&nbsp;<\/div>\\r\\n<div id=\\\"north-564\\\" class=\\\"tab-pane active\\\"><img src=\\\"images\/yoga_img\/kulvardhana_yoga_n.jpg\\\" alt=\\\"kulvardhana\\\" title=\\\"kulvardhana yoga north\\\" \/><\/div>\\r\\n<div id=\\\"south-564\\\" class=\\\"tab-pane\\\"><img src=\\\"images\/yoga_img\/kulvardhana_yoga_s.jpg\\\" alt=\\\"kulvardhana\\\" title=\\\"kulvardhana yoga south\\\" \/><\/div>\\r\\n<\/div>\\r\\n<div class=\\\"mb-3\\\">&nbsp;<\/div>\\r\\n<div class=\\\"lead alert alert-dark\\\">Results of Yupa Yoga<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yupa Yoga gives a charitable and noble nature. It also makes one adopt a liberal approach to life. He\/She is calm, confident and in control of one\\'s feelings.<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">Remarks on Yupa Yoga<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;B. V. Raman does not think too highly of Akriti Yogas of which Yupa Yoga is a part. He thinks they don\\'t contribute much to the success of an individual. According to B. V. Ramam they give a better idea about means of livelihood a person will have.<\/p>',`fulltext`='',`state`='1',`catid`='14',`created`='2022-07-23 10:12:25',`created_by`='222',`created_by_alias`='',`modified`='2022-07-23 10:59:16',`modified_by`='222',`checked_out`='222',`checked_out_time`='2022-07-23 10:48:31',`publish_up`='2022-07-23 10:12:25',`publish_down`=NULL,`images`='{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}',`urls`='{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}',`attribs`='{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"